public class A02_AssignmentOperatorsDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		int j,k;
		j=10;
		j=5;
		k=j;
		
		System.out.println(" j is : " +j);
		System.out.println(" k is : " +k);
		
		k=j=10;
		
		System.out.println(" j is : " +j);
		System.out.println(" k is : " +k);
		

	}

}
